pragma solidity ^0.5.0;

import "./Rider.sol";

contract RiderFactory {
    address owner;
    address controller;
    
    uint riderCount;
    mapping(uint => Rider) riders;
    
    constructor() public
    {
        controller = msg.sender;
        owner = tx.origin;
        riderCount = 0;
    }
    
    function makeCustomer(string calldata name, string calldata contactNumber) external returns(address customer){
        riderCount++;
        Rider newRider = new Rider(riderCount, name, contactNumber);
        return address(newRider);
    }
}
